
basic_ext_pop() {
  local n=$(($1 - ${2:-1} + 1))
  local arguments=""
  for (( index=1; index < n; index++ )) do
    arguments+=" \"\${$index}\""
  done
  POP_EXPR="set -- $arguments"
}

test_basic_ext_pop() {
  basic_ext_pop $#
  eval "$POP_EXPR"
  echo "$@"
}


basic_ext_pop_next() {
  POP_EXPR="${POP_EXPR% \"*}"
}

