g100_ext_pop() {
  local n=$(($1 - ${2:-1} + 1))
  case $n in
    1) POP_EXPR='set -- ' ;;
    2) POP_EXPR='set -- "${1}"' ;;
    3) POP_EXPR='set -- "${1}" "${2}"' ;;
    4) POP_EXPR='set -- "${1}" "${2}" "${3}"' ;;
    5) POP_EXPR='set -- "${1}" "${2}" "${3}" "${4}"' ;;
    6) POP_EXPR='set -- "${1}" "${2}" "${3}" "${4}" "${5}"' ;;
    7) POP_EXPR='set -- "${1}" "${2}" "${3}" "${4}" "${5}" "${6}"' ;;
    8) POP_EXPR='set -- "${1}" "${2}" "${3}" "${4}" "${5}" "${6}" "${7}"' ;;
    9) POP_EXPR='set -- "${1}" "${2}" "${3}" "${4}" "${5}" "${6}" "${7}" "${8}"' ;;
    *)
      if [ $n -ge 100 ]; then
        batch_g100_ext_pop100 $n
      else
        batch_g100_ext_pop10 $n
      fi
      ;;
  esac
}

